PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?color ?colorLabel WHERE {
  fb:m.03ksy fb:education.educational_institution.colors ?color .
  OPTIONAL {
    ?color fb:type.object.name ?colorLabel .
    FILTER ( lang( ?colorLabel ) = 'en' )
  }
}

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?country WHERE {
  fb:m.0261m fb:location.location.contains ?country .
  ?country a fb:location.country .
  ?country fb:location.location.time_zones fb:m.042g7t .
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?film ( SAMPLE( ?enLabel ) AS ?film_label ) WHERE {
  ?performance fb:film.performance.actor fb:m.07ldhs .
  ?performance fb:film.performance.film ?film .
  ?film fb:film.film.genre fb:m.01jfsb .
  OPTIONAL {
    ?film rdfs:label ?enLabel FILTER ( lang( ?enLabel ) = 'en' )
  }
  OPTIONAL {
    ?film rdfs:label ?anyLabel
  }
}
GROUP BY ?film

