# Office position held from March 19, 1790
SELECT ?posrel ?position ?position_label ?officeholder ?officeholder_label WHERE {
  ?posrel a fb:government.government_position_held .
  ?posrel fb:government.government_position_held.from "1790-03-19"^^xsd:date .
  ?posrel fb:government.government_position_held.office_position_or_title ?position .
  OPTIONAL { ?position rdfs:label ?position_label }
  OPTIONAL { ?posrel fb:government.government_position_held.office_holder ?officeholder . ?officeholder rdfs:label ?officeholder_label }
}

# Abraham Lincoln's political experience
SELECT ?position ?position_label ?from ?to ?body ?body_label ?district ?district_label ?jurisdiction ?jurisdiction_label WHERE {
  VALUES ?lincoln { fb:m.0gzh }
  ?posrel2 fb:government.government_position_held.office_holder ?lincoln .
  ?posrel2 fb:government.government_position_held.office_position_or_title ?position .
  OPTIONAL { ?position rdfs:label ?position_label }
  OPTIONAL { ?posrel2 fb:government.government_position_held.from ?from }
  OPTIONAL { ?posrel2 fb:government.government_position_held.to ?to }
  OPTIONAL { ?posrel2 fb:government.government_position_held.governmental_body ?body . ?body rdfs:label ?body_label }
  OPTIONAL { ?posrel2 fb:government.government_position_held.district_represented ?district . ?district rdfs:label ?district_label }
  OPTIONAL { ?posrel2 fb:government.government_position_held.jurisdiction_of_office ?jurisdiction . ?jurisdiction rdfs:label ?jurisdiction_label }
} ORDER BY ?from

